    render() {
        return (
            // <MuiThemeProvider theme={theme}>
            <AppBar position="fixed" id="appbar" color="inherit">
                <Toolbar>
                    <div id="appBarMenuAndTitle">
                        <div>
                            <IconButton color="inherit" aria-label="Open drawer" >
                                <Tooltip title="Menu">
                                    <MenuIcon id="menu"  />
                                </Tooltip>
                            </IconButton>
                        </div>
                        <div id="keepImage">
                             <img src={require('/home/bridgeit/Shweta/fundooNotes/frontend/src/assets/images/keep.png')} alt="keep icon" /> 
                        </div>
                        <span className="title"><b>fundooNotes</b></span>
                    </div>

                    <div id="appBarIcons">
                        <div id="searchBar">
                            <IconButton color="inherit" aria-label="Open drawer" style={{ marginLeft: "8px" }} >
                                <Tooltip title="Search">
                                    <SearchIcon style={{ color: "gray" }} />
                                </Tooltip>
                            </IconButton>

                            <InputBase
