                                </Tooltip>
                            </IconButton>
                        </div>
                        <div>
                            <IconButton>
                                <Tooltip title="ListView" >
                                    <img src={require('/home/bridgeit/Shweta/fundooNotes/frontend/src/assets/images/listView.svg')} alt="refresh icon" />
                                </Tooltip>
                            </IconButton>
                        </div>
                        <div>
